import React from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [bids, setBids] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:5000/getBid')
      .then(response => {
        setBids(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <ul>
      {bids.map(bid => (
        <li key={bid.name}>{bid.price}</li>
      ))}
    </ul>
  );
}

export default App;
